void hls_xfft2real::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"din_TDATA\" :  \"" << din_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"din_TLAST\" :  \"" << din_TLAST.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"dout_V_TDATA\" :  \"" << dout_V_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"din_TVALID\" :  \"" << din_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"din_TREADY\" :  \"" << din_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"dout_V_TVALID\" :  \"" << dout_V_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dout_V_TREADY\" :  \"" << dout_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

